    "           las = 1,\n",
    "           border = \"chocolate\",\n",
    "           shade = TRUE)\n",
    "mosaicplot(table1, main = \"Branch and product line\",\n",
    "           xlab = \"Branch\",\n",
    "           ylab = \"Product line\",\n",
    "           las = 1,\n",
    "           border = \"chocolate\",\n",
    "           shade = TRUE)"
   ]
